using System;
using static PKHeX.Core.EntityContext;
using static PKHeX.Core.LanguageID;

namespace PKHeX.Core;

/// <summary>
/// Utility Logic for checking whether a Unicode character is defined in a font.
/// </summary>
public static class StringFontUtil
{
    /// <summary>
    /// Determines if a string contains undefined characters in the font for the given <see cref="EntityContext"/> and <see cref="LanguageID"/>.
    /// </summary>
    /// <param name="str">The input string to check for undefined characters.</param>
    /// <param name="context">The context to get the font for.</param>
    /// <param name="pkLanguage">The language of the Pokémon.</param>
    /// <param name="saveLanguage">The language of the save file.</param>
    /// <returns>True if the input string contains undefined characters; otherwise, false.</returns>
    public static bool HasUndefinedCharacters(ReadOnlySpan<char> str, EntityContext context, LanguageID pkLanguage, LanguageID saveLanguage)
    {
        // Gen5/6/7 display names based on the save language, Gen7b/8/9 display names based on the name's language
        var language = context <= Gen7 ? saveLanguage : pkLanguage;
        foreach (var c in str)
        {
            if (!IsDefined(context, language, c))
                return true;
        }
        return false;
    }

    /// <summary>
    /// Determines if a string contains undefined characters in the font for the given <see cref="EntityContext"/> and <see cref="LanguageID"/>.
    /// </summary>
    /// <param name="str">The input string to check for undefined characters.</param>
    /// <param name="context">The context to get the font for.</param>
    /// <param name="language">The language of the Pokémon.</param>
    /// <returns>True if the input string contains undefined characters; otherwise, false.</returns>
    public static bool HasUndefinedCharacters(ReadOnlySpan<char> str, EntityContext context, LanguageID language) => HasUndefinedCharacters(str, context, language, language);

    /// <summary>
    /// Replaces any undefined characters in the font for the given <see cref="EntityContext"/> and <see cref="LanguageID"/> within a string with a fallback character.
    /// </summary>
    /// <param name="str">The input string to replace any undefined characters in.</param>
    /// <param name="context">The context to get the font for.</param>
    /// <param name="pkLanguage">The language of the Pokémon.</param>
    /// <param name="saveLanguage">The language of the save file.</param>
    /// <returns>The resulting string.</returns>
    public static string ReplaceUndefinedCharacters(ReadOnlySpan<char> str, EntityContext context, LanguageID pkLanguage, LanguageID saveLanguage)
    {
        // BD/SP behaves differently from other games:
        // - For strings in the same language as the save file, an empty string is shown in place of text with any undefined characters 
        // - For strings in a different language from the save file, undefined characters fall back to the save language font before .notdef

        var language = context <= Gen7 ? saveLanguage : pkLanguage;
        var notdef = context switch
        {
            Gen7 => ' ',
            Gen8b => '☐',
            _ => '?',
        };
        var blankIfUndefined = context is Gen8b && pkLanguage == saveLanguage;

        Span<char> result = stackalloc char[str.Length];
        int i = 0;
        foreach (var c in str)
        {
            var defined = IsDefined(context, language, c) || (context is Gen8b && IsDefined(context, saveLanguage, c));
            if (blankIfUndefined && !defined)
                return "";
            result[i++] = defined ? c : notdef;
        }
        return new string(result[..i]);
    }

    /// <summary>
    /// Determines if a character is defined in the font for the given <see cref="EntityContext"/> and <see cref="LanguageID"/>.
    /// </summary>
    /// <param name="context">The context to get the font for.</param>
    /// <param name="language">The language to get the font for.</param>
    /// <param name="c">The character to check.</param>
    /// <returns>True if the character is defined; otherwise, false.</returns>
    public static bool IsDefined(EntityContext context, LanguageID language, char c) => context switch
    {
        Gen5 or Gen3 or Gen4 => GetFlag(G5Defined, c),
        Gen6 => GetFlag(G6Defined, c),
        Gen7 or Gen1 or Gen2 => IsDefined7(language, c),
        Gen7b or Gen8 or Gen8b or Gen9 => IsDefined8(language, c),
        Gen8a => IsDefined8a(language, c),
        _ => throw new ArgumentOutOfRangeException(nameof(context), context, null),
    };

    private static bool IsDefined7(LanguageID language, char c)
    {
        if (c is < '\u4E00' or > '\u9FFF')
            return GetFlag(G7Defined, c) || (language is ChineseT && G7DefinedCHTOnly.BinarySearch(c) >= 0);

        return language switch
        {
            ChineseT => GetFlag(G7DefinedCHT, c - '\u4E00'),
            ChineseS => GetFlag(G7DefinedCHS, c - '\u4E00'),
            _ => GetFlag(G7Defined, c),
        };
    }

    private static bool IsDefined8(LanguageID language, char c)
    {
        var table = language switch
        {
            Japanese => G8DefinedJPN,
            Korean => G8DefinedKOR,
            ChineseS => G8DefinedCHS,
            ChineseT => G8DefinedCHT,
            _ => G8DefinedINTL,
        };
        return GetFlag(table, c) || G8DefinedPrivate.BinarySearch(c) >= 0;
    }

    private static bool IsDefined8a(LanguageID language, char c) => IsDefined8(language, c) || G8aDefinedPrivate.BinarySearch(c) >= 0;

    private static bool GetFlag(ReadOnlySpan<byte> table, int i) => FlagUtil.GetFlag(table, i / 8, i % 8);

